import React from 'react';
import NavLink from '../util/NavLink';

import '../css/Navbar.css'

function Navbar() {
  return (
      <div className='navbar'>
          <div className='links'>
              <NavLink 
                description='Create Exam'
                route='/dashboard'
                icon='fas fa-tachometer-alt'
              />
              <NavLink 
                description='Create Exam'
                route='/create-exam'
                icon='fas fa-plus-square'
              />
              <i class=""></i>
          </div>
      </div>
  );
}

export default Navbar;
